import "./header.css";

export default function Header() {
  return (
    <div className="header">

      <img
        className="headerImg"
        src="https://cloudify.co/wp-content/uploads/2020/12/shutterstock_769455496-scaled-e1608110200136.jpg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940"
        alt=""
      />
      <div id = "error_box"></div>
    </div>
  );
}
